import React from "react";
import "../styles/WorkerDashboard.css";

const WorkerDashboard = () => {
  return (
    <div className="dashboard-container">
      <h1>Welcome to the Worker Dashboard</h1>
    </div>
  );
};

export default WorkerDashboard;
